import Layout from '../../components/Layout';
import Link from 'next/link';

function Blog(){
    const title = 'Blog';
    return(
        <Layout title={title}>
            <ul>
                <li> 
                    <Link href="#">
                        <a>Blog Post #1</a>
                    </Link>
                </li>
                <li> Blog Post #2</li>
                <li> Blog Post #3</li>
            </ul>
        </Layout>
    )
}
export default Blog;
